import {View, Text, StyleSheet, FlatList} from 'react-native';

var data = [
  {name: 'zaeem ahmad'},
  {name: 'ali'},
  {name: 'talha'},
  {name: 'hassan'},
  {name: 'ikhlaq'},
  {name: 'babar'},
  {name: 'sufi'},
  {name: 'faisal'},
  {name: 'umair'},
  {name: 'farhan'},
  {name: 'adnan'},
  {name: 'bilal'},
];

const App = () => {
  return(
    <View>
      <FlatList data={data} renderItem={(element) => {console.log(element)
        return (<Text key={(element.index).toString}>{element.item.name}</Text>)
      }}/>
    </View>
  )
}

export default App;

const styles = StyleSheet.create({
  text: {
    backgroundColor: 'green'
  }
});
